     />
     <div className="login__container">
       <h1>Sign-In</h1>

       <form>
         <h5>E-mail</h5>
      <input
         type={text}
         value={email}
         onChange={(e) =>setEmail(e.target.value)}
      />
       
       </form>
     </div>
    </div>
  )
}

